class Observable{constructor(s){this._value=s,this._subs={}}get value(){return this._value}set value(s){const e=this._value;this._value=s,Object.getOwnPropertySymbols(this._subs).forEach(s=>{this._subs[s](this._value,e)})}subscribe(s){const e=Symbol();return this._subs[e]=s,()=>{delete this._subs[e]}}}export default Observable;